this["Fliplet"]["Widget"]["Templates"]["templates.build.agenda-base"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"new-agenda-list-container loading{{#if hasTopBar}} has-top-bar{{/if}}{{#if showAddEntry}} has-add-entry{{/if}}\">\n  <!-- Filter Overlay -->\n  {{#if filtersInOverlay}}\n  <div class=\"new-agenda-search-filter-overlay\">\n    <div class=\"agenda-overlay-screen\"></div>\n    <div class=\"agenda-overlay-wrapper\">\n      <div class=\"agenda-overlay-header\">\n        <div class=\"agenda-overlay-close focus-outline\" tabindex=\"0\">\n          <i class=\"fa fa-angle-left\"></i>\n        </div>\n        <div class=\"filter-header-holder\">\n          <div class=\"filter-header-btn-controls\">\n            <div class=\"btn clear-filters hidden focus-outline\" tabindex=\"0\">Clear</div>\n            <div class=\"btn apply-filters focus-outline\" tabindex=\"0\">Apply</div>\n          </div>\n        </div>\n      </div>\n      <div class=\"agenda-overlay-content\">\n        <div class=\"hidden-filter-controls\">\n          <div class=\"hidden-filter-controls-content\">\n            <div class=\"filters-header\">Filter by</div>\n            <div class=\"filter-holder\">\n              <!-- Filters here -->\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n  {{/if}}\n  <!-- End of Filter Overlay -->\n\n  <!-- Top bar with profile and search icons -->\n  <div class=\"section-top-wrapper\">\n    {{#if searchEnabled}}\n    <div class=\"search-holder\">\n      <i class=\"fa fa-search\"></i>\n      <input type=\"search\" name=\"search-feed\" class=\"form-control search-feed focus-outline\" tabindex=\"0\" placeholder=\"Search...\" required >\n      <div class=\"btn btn-default search-btn\">Search</div>\n      <div class=\"btn btn-default search-btn searching-btn\"><i class=\"fa fa-spinner fa-pulse fa-fw\"></i></div>\n    </div>\n    {{/if}}\n    {{#ifCond filtersEnabled '||' bookmarksEnabled}}\n    <div class=\"list-search-icon\">\n      {{#ifCond bookmarksEnabled '&&' hasTopBar}}\n      <div class=\"toggle-bookmarks focus-outline\" tabindex=\"0\" data-mixitup-control=\"{{id}}\" data-toggle=\".bookmarked\" >\n        <span class=\"fa fa-bookmark-o\"></span>\n        <span class=\"fa fa-bookmark\"></span>\n      </div>\n      {{/ifCond}}\n      <div class=\"list-search-cancel focus-outline\" tabindex=\"0\" ><span class=\"fa fa-times\"></span></div>\n      {{#if filtersEnabled}}\n      <i class=\"fa fa-sliders focus-outline\" tabindex=\"0\"></i>\n      {{/if}}\n    </div>\n    {{/ifCond}}\n  </div>\n  <!-- End of Top bar -->\n\n  {{#if bookmarksEnabled}}\n    {{#unless hasTopBar}}\n    <div class=\"agenda-list-controls focus-outline\" tabindex=\"1\">\n      <div class=\"toggle-agenda\" data-mixitup-control=\"{{id}}\" data-toggle=\".bookmarked\">\n        <span class=\"fa fa-bookmark-o\"></span>\n        <span class=\"fa fa-bookmark\"></span>\n        <div class=\"agenda-list-label\">My Agenda</div>\n      </div>\n    </div>\n    {{/unless}}\n  {{/if}}\n\n  <!-- Days slider -->\n  <div class=\"agenda-date-selector\">\n    <ul>\n      <!-- Day filter will be added here -->\n    </ul>\n  </div>\n\n  <!-- Agenda Cards -->\n  <div class=\"agenda-cards-wrapper\" id=\"agenda-cards-wrapper-{{id}}\">\n    <div class=\"agenda-list-holder\" role=\"list\">\n      <!-- Cards will be rendered here -->\n    </div>\n    <!-- States messages -->\n    <div class=\"agenda-state-messages\">\n      <div class=\"loading-holder\">\n        <i class=\"fa fa-circle-o-notch fa-spin\"></i> Loading agenda...\n      </div>\n    </div>\n  </div>\n\n  <!-- Search results -->\n  <div class=\"search-results-wrapper\">\n    <!-- Inline Search and Filters -->\n    <div class=\"hidden-controls\">\n      {{#if searchEnabled}}\n      <div class=\"hidden-search-controls\">\n        <div class=\"hidden-search-controls-content\">\n          <div class=\"hidden-filter-controls-search\">\n            <div class=\"search-query-holder\">\n              <div class=\"search-query\">\n              Searching for <span class=\"current-query-wrapper\"><span class=\"current-query\"></span><span class=\"clear-search focus-outline\" tabindex=\"0\"><i class=\"fa fa-times\"></i></span></span>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n      {{/if}}\n      <div class=\"active-filters\">\n        <div class=\"hidden-filter-controls-label\">Filters applied</div>\n        <div class=\"hidden-filter-controls-filter-container hidden\" touch-action=\"pan-x pan-y\">\n          <div class=\"hidden-filter-controls-filter-wrapper\">\n            <fieldset data-filter-active-group>\n            </fieldset>\n          </div>\n        </div>\n      </div>\n      {{#if filtersEnabled}}\n      <div class=\"hidden-filter-controls\">\n        <div class=\"hidden-filter-controls-content\">\n          {{#unless filtersInOverlay}}\n            {{#if filtersEnabled}}\n            <div class=\"filter-holder inline-filter-holder\">\n              <!-- Filters here -->\n            </div>\n            {{/if}}\n          {{/unless}}\n        </div>\n      </div>\n      {{/if}}\n    </div>\n    <!-- End of Inline Search and Filters -->\n    <div class=\"search-results-holder\"></div>\n  </div>\n</div>\n\n<!-- Detail view overlay -->\n<div class=\"agenda-detail-overlay\" id=\"agenda-detail-overlay-{{id}}\">\n  <div class=\"agenda-detail-overlay-wrapper\">\n    <div class=\"agenda-detail-overlay-panel\">\n      <div class=\"agenda-detail-overlay-close focus-outline {{#if previousScreen}}go-previous-screen{{/if}}\" tabindex=\"0\">\n        <img src=\"{{closeIcon.black.url}}\" alt=\"close icon\" class=\"close-icon\">\n      </div>\n      <div class=\"agenda-detail-overlay-content\">\n        <div class=\"agenda-detail-overlay-content-holder\">\n          <!-- Details will be added here -->\n        </div>\n      </div>\n    </div>\n    <div class=\"agenda-detail-overlay-close tablet {{#if previousScreen}}go-previous-screen{{/if}}\" >\n      <img src=\"{{closeIcon.black.url}}\" alt=\"close icon\" class=\"close-icon\">\n    </div>\n  </div>\n  <div class=\"agenda-detail-overlay-screen {{#if previousScreen}}go-previous-screen{{/if}}\"></div>\n</div>\n\n{{#if showAddEntry}}\n<div class=\"dynamic-list-add-item focus-outline\" tabindex=\"1\">\n  <i class=\"fa fa-plus\"></i>\n</div>\n{{/if}}";
},"useData":true});

this["Fliplet"]["Widget"]["Templates"]["templates.build.agenda-cards-detail"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"agenda-item-inner-content clearfix\" data-entry-id=\"{{id}}\">\n  <div class=\"agenda-item-content-holder\">\n    {{#if [Title]}}\n    <h2 class=\"agenda-item-title\">{{[Title]}}</h2>\n    {{/if}}\n    <div class=\"agenda-item-session-location\">\n      {{#if [Location]}}\n      <p class=\"agenda-item-location\">{{{[Location]}}}</p>\n      {{/if}}\n      <p class=\"agenda-item-start-date-time\">{{[Start Time]}}{{#ifCond [Start Time] '&&' [End Time]}} - {{/ifCond}}{{[End Time]}}{{#if [Full Date]}} / {{/if}}{{moment [Full Date] format=\"D MMM YYYY\"}}</p>\n    </div>\n\n    <div class=\"agenda-item-bookmark {{#if agendaButtonsEnabled}}more-buttons{{/if}}\">\n      <div class=\"agenda-item-bookmark-holder agenda-item-bookmark-holder-{{id}}\">\n        <div class=\"bookmark-wrapper focus-outline btn-bookmark\" tabindex=\"0\">\n          <i class=\"fa fa-bookmark-o\"></i>Bookmark\n        </div>\n        <div class=\"bookmark-wrapper focus-outline btn-bookmarked\" tabindex=\"0\">\n          <i class=\"fa fa-bookmark\"></i>Bookmarked\n        </div>\n\n        <div class=\"agenda-item-add-agenda\"></div>\n      </div>\n      {{#if pollButton}}\n      <div class=\"go-to-poll session-button focus-outline\" tabindex=\"0\">\n        <i class=\"fa fa-pie-chart\"></i>Poll\n      </div>\n      {{/if}}\n      {{#if surveyButton}}\n      <div class=\"go-to-survey session-button focus-outline\" tabindex=\"0\">\n        <i class=\"fa fa-pencil-square-o\"></i>Survey\n      </div>\n      {{/if}}\n      {{#if questionsButton}}\n      <div class=\"go-to-questions session-button focus-outline\" tabindex=\"0\">\n        <i class=\"fa fa-question-circle-o\"></i>Questions\n      </div>\n      {{/if}}\n    </div>\n\n    <div class=\"agenda-item-description\">\n      {{#each entryDetails}}\n        <!-- Image template -->\n        {{#ifCond type '==' 'image'}}\n          {{#if content}}\n            {{#if labelEnabled}}\n              <div class=\"agenda-item-detail-label\">{{label}}</div>\n            {{/if}}\n            {{#if (isSingle contentArray)}}\n              <div class=\"agenda-item-detail-body-text\">\n                <img src=\"{{validateImage content}}\">\n              </div>\n            {{else}}\n              <div class=\"multiple-images-holder\" data-detail-entry-id=\"{{id}}\">\n                {{#each contentArray}}\n                  <div class=\"multiple-images-item focus-outline\" tabindex=\"0\">\n                    <div class=\"image\" style=\"background-image: url('{{validateImage this}}')\"></div>\n                  </div>\n                {{/each}}\n              </div>\n            {{/if}}\n          {{/if}}\n        {{/ifCond}}\n\n        <!-- Plain text template -->\n        {{#ifCond type '==' 'text'}}\n          {{#if content}}\n            {{#if labelEnabled}}\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\n            {{/if}}\n\n            <div class=\"agenda-item-detail-body-text\">{{content}}</div>\n          {{/if}}\n        {{/ifCond}}\n\n        <!-- HTML template -->\n        {{#ifCond type '==' 'html'}}\n          {{#if content}}\n            {{#if labelEnabled}}\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\n            {{/if}}\n\n            <div class=\"agenda-item-detail-body-text\">{{{auth content}}}</div>\n          {{/if}}\n        {{/ifCond}}\n\n        <!-- URL template -->\n        {{#ifCond type '==' 'url'}}\n          {{#if content}}\n            {{#if labelEnabled}}\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\n            {{/if}}\n\n            <div class=\"agenda-item-detail-body-text\">\n              <a href=\"{{{auth content}}}\" target=\"_blank\">Tap to open</a>\n            </div>\n          {{/if}}\n        {{/ifCond}}\n\n        <!-- Telephone template -->\n        {{#ifCond type '==' 'tel'}}\n          {{#if content}}\n            {{#if labelEnabled}}\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\n            {{/if}}\n\n            <div class=\"agenda-item-detail-body-text\">\n              <a href=\"tel:{{removeSpaces content}}\" target=\"_blank\">{{content}}</a>\n            </div>\n          {{/if}}\n        {{/ifCond}}\n\n        <!-- Email template -->\n        {{#ifCond type '==' 'mail'}}\n          {{#if content}}\n            {{#if labelEnabled}}\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\n            {{/if}}\n\n            <div class=\"agenda-item-detail-body-text\">\n              <a href=\"mailto:{{content}}\" target=\"_blank\">{{content}}</a>\n            </div>\n          {{/if}}\n        {{/ifCond}}\n\n        <!-- Date template -->\n        {{#ifCond type '==' 'date'}}\n          {{#if content}}\n            {{#if labelEnabled}}\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\n            {{/if}}\n\n            <div class=\"agenda-item-detail-body-text\">{{formatDate content}}</div>\n          {{/if}}\n        {{/ifCond}}\n\n        <!-- File template -->\n        {{#ifCond type '==' 'file'}}\n          {{#if content}}\n            <ul class=\"file-holder\">\n              {{#if labelEnabled}}\n                <div class=\"agenda-item-detail-label\">{{label}}</div>\n              {{/if}}\n              {{#each content}}\n                <li class=\"file-item\">\n                  <div class=\"file-title\">{{this.name}}</div>\n                  <div class=\"file-info\">\n                    <span class=\"file-info-uploaded\">Uploaded: {{formatDate this.uploaded}}</span>\n                    {{#if this.size}}<span class=\"file-info-size\">&ndash; {{humanFileSize this.size}}</span>{{/if}}\n                  </div>\n                  <input type=\"hidden\" value={{this.url}}>\n                  <div class=\"file-icon\">\n                    <i class=\"fa fa-angle-right\"></i>\n                  </div>\n                </li>\n              {{/each}}\n            </ul>\n          {{/if}}\n        {{/ifCond}}\n\n      {{/each}}\n    </div>\n\n    {{#ifCond editEntry '||' deleteEntry}}\n    <div class=\"dynamic-list-controls\">\n      {{#if editEntry}}\n      <div class=\"btn btn-default dynamic-list-edit-item focus-outline\" tabindex=\"0\">Edit</div>\n      {{/if}}\n      {{#if deleteEntry}}\n      <div class=\"btn btn-danger dynamic-list-delete-item focus-outline\" tabindex=\"0\">Delete</div>\n      {{/if}}\n    </div>\n    {{/ifCond}}\n  </div>\n</div>";
},"useData":true});

