   <!-- URL template -->\n          {{#ifCond type '==' 'url'}}\n            {{#if content}}\n              {{#if labelEnabled}}\n              <div class=\"news-feed-detail-label\">{{label}}</div>\n              {{/if}}\n\n              <div class=\"news-feed-detail-value\">\n                <a href=\"{{{auth content}}}\" target=\"_blank\">Tap to open</a>\n              </div>\n            {{/if}}\n          {{/ifCond}}\n\n          <!-- Telephone template -->\n          {{#ifCond type '==' 'tel'}}\n            {{#if content}}\n              {{#if labelEnabled}}\n              <div class=\"news-feed-detail-label\">{{label}}</div>\n              {{/if}}\n\n              <div class=\"news-feed-detail-value\">\n                <a href=\"tel:{{removeSpaces content}}\" target=\"_blank\">{{content}}</a>\n              </div>\n            {{/if}}\n          {{/ifCond}}\n\n          <!-- Email template -->\n          {{#ifCond type '==' 'mail'}}\n            {{#if content}}\n              {{#if labelEnabled}}\n              <div class=\"news-feed-detail-label\">{{label}}</div>\n              {{/if}}\n\n              <div class=\"news-feed-detail-value\">\n                <a href=\"mailto:{{content}}\" target=\"_blank\">{{content}}</a>\n              </div>\n            {{/if}}\n          {{/ifCond}}\n\n          <!-- Date template -->\n          {{#ifCond type '==' 'date'}}\n            {{#if content}}\n              {{#if labelEnabled}}\n              <div class=\"news-feed-detail-label\">{{label}}</div>\n              {{/if}}\n\n              <div class=\"news-feed-detail-value\">{{formatDate content}}</div>\n            {{/if}}\n          {{/ifCond}}\n\n          <!-- File template -->\n          {{#ifCond type '==' 'file'}}\n            {{#if content}}\n              <ul class=\"file-holder\">\n                {{#if labelEnabled}}\n                  <div class=\"news-feed-detail-label\">{{label}}</div>\n                {{/if}}\n                {{#each content}}\n      