this["Fliplet"]["Widget"]["Templates"]["templates.build.simple-list-detail"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"simple-list-details-holder\" data-entry-id=\"{{id}}\">\n  {{#each data}}\n    <!-- Image template -->\n    {{#ifCond type '==' 'image'}}\n      {{#if content}}\n        {{#if labelEnabled}}\n          <div class=\"simple-list-detail-label\">{{label}}</div>\n        {{/if}}\n        {{#if (isSingle contentArray)}}\n          <div class=\"simple-list-detail-body-text\">\n            <img src=\"{{validateImage content}}\">\n          </div>\n        {{else}}\n          <div class=\"multiple-images-holder\" data-detail-entry-id=\"{{id}}\">\n            {{#each contentArray}}\n              <div class=\"multiple-images-item focus-outline\" tabindex=\"0\">\n                <div class=\"image\" style=\"background-image: url('{{validateImage this}}')\"></div>\n              </div>\n            {{/each}}\n          </div>\n        {{/if}}\n      {{/if}}\n    {{/ifCond}}\n\n    <!-- Plain text template -->\n    {{#ifCond type '==' 'text'}}\n      {{#if content}}\n        {{#if labelEnabled}}\n        <div class=\"simple-list-detail-label\">{{label}}</div>\n        {{/if}}\n\n        <div class=\"simple-list-detail-value\">{{content}}</div>\n      {{/if}}\n    {{/ifCond}}\n\n    <!-- HTML template -->\n    {{#ifCond type '==' 'html'}}\n      {{#if content}}\n        {{#if labelEnabled}}\n        <div class=\"simple-list-detail-label\">{{label}}</div>\n        {{/if}}\n\n        <div class=\"simple-list-detail-value\">{{{auth content}}}</div>\n      {{/if}}\n    {{/ifCond}}\n\n    <!-- URL template -->\n    {{#ifCond type '==' 'url'}}\n      {{#if content}}\n        {{#if labelEnabled}}\n        <div class=\"simple-list-detail-label\">{{label}}</div>\n        {{/if}}\n\n        <div class=\"simple-list-detail-value\">\n          <a href=\"{{{auth content}}}\" target=\"_blank\">Tap to open</a>\n        </div>\n      {{/if}}\n    {{/ifCond}}\n\n    <!-- Telephone template -->\n    {{#ifCond type '==' 'tel'}}\n      {{#if content}}\n        {{#if labelEnabled}}\n        <div class=\"simple-list-detail-label\">{{label}}</div>\n        {{/if}}\n\n        <div class=\"simple-list-detail-value\">\n          <a href=\"tel:{{removeSpaces content}}\" target=\"_blank\">{{content}}</a>\n        </div>\n      {{/if}}\n    {{/ifCond}}\n\n    <!-- Email template -->\n    {{#ifCond type '==' 'mail'}}\n      {{#if content}}\n        {{#if labelEnabled}}\n        <div class=\"simple-list-detail-label\">{{label}}</div>\n        {{/if}}\n\n        <div class=\"simple-list-detail-value\">\n          <a href=\"mailto:{{content}}\" target=\"_blank\">{{content}}</a>\n        </div>\n      {{/if}}\n    {{/ifCond}}\n\n    <!-- Date template -->\n    {{#ifCond type '==' 'date'}}\n      {{#if content}}\n        {{#if labelEnabled}}\n        <div class=\"simple-list-detail-label\">{{label}}</div>\n        {{/if}}\n\n        <div class=\"simple-list-detail-value\">{{formatDate content}}</div>\n      {{/if}}\n    {{/ifCond}}\n\n    <!-- File template -->\n    {{#ifCond type '==' 'file'}}\n      {{#if content}}\n        <ul class=\"file-holder\">\n          {{#if labelEnabled}}\n            <div class=\"simple-list-detail-label\">{{label}}</div>\n          {{/if}}\n          {{#each content}}\n            <li class=\"file-item\">\n              <div class=\"file-title\">{{this.name}}</div>\n              <div class=\"file-info\">\n                <span class=\"file-info-uploaded\">Uploaded: {{formatDate this.uploaded}}</span>\n                {{#if this.size}}<span class=\"file-info-size\">&ndash; {{humanFileSize this.size}}</span>{{/if}}\n              </div>\n              <input type=\"hidden\" value={{this.url}}>\n              <div class=\"file-icon\">\n                <i class=\"fa fa-angle-right\"></i>\n              </div>\n            </li>\n          {{/each}}\n        </ul>\n      {{/if}}\n    {{/ifCond}}\n\n  {{/each}}\n\n  <!-- Edit and Delete buttons -->\n  <div class=\"simple-list-overlay-inner-holder {{#ifCond editEntry '||' deleteEntry}}has-edit-controls{{/ifCond}}\">\n    {{#ifCond editEntry '||' deleteEntry}}\n    <div class=\"dynamic-list-controls\">\n      {{#if editEntry}}\n      <div class=\"btn btn-default dynamic-list-edit-item focus-outline\" tabindex=\"0\">Edit</div>\n      {{/if}}\n      {{#if deleteEntry}}\n      <div class=\"btn btn-danger dynamic-list-delete-item focus-outline\" tabindex=\"0\">Delete</div>\n      {{/if}}\n    </div>\n    {{/ifCond}}\n    <div class=\"simple-list-overlay-social-holder\">\n      {{#if likesEnabled}}\n      <div class=\"simple-list-like-holder simple-list-like-holder-{{id}}\">\n        <div class=\"simple-list-like-wrapper btn-like focus-outline\" tabindex=\"0\">\n          <span class=\"count\"></span><i class=\"fa fa-heart-o fa-lg\"></i>\n        </div>\n        <div class=\"simple-list-like-wrapper btn-liked focus-outline\" tabindex=\"0\">\n          <span class=\"count\"></span><i class=\"fa fa-heart fa-lg animated bounceIn\"></i>\n        </div>\n      </div>\n      {{/if}}\n\n      {{#if bookmarksEnabled}}\n      <div class=\"simple-list-bookmark-holder simple-list-bookmark-holder-{{id}}\">\n        <div class=\"simple-list-bookmark-wrapper btn-bookmark focus-outline\" tabindex=\"0\">\n          <i class=\"fa fa-bookmark-o fa-lg\"></i>\n        </div>\n        <div class=\"simple-list-bookmark-wrapper btn-bookmarked focus-outline\" tabindex=\"0\">\n          <i class=\"fa fa-bookmark fa-lg animated fadeIn\"></i>\n        </div>\n      </div>\n      {{/if}}\n\n      {{#if commentsEnabled}}\n      <div class=\"simple-list-comment-holder simple-list-comemnt-holder-{{id}} focus-outline\" tabindex=\"0\">\n        <!-- Like button will be here -->\n        <!-- Like placeholder -->\n        <i class=\"fa fa-comment-o fa-lg comment-placeholder\"></i>\n      </div>\n      {{/if}}\n    </div>\n  </div>\n</div>";
},"useData":true});

